    "5956cda2789eff0e28cf9d542c0eb8ac475c5da7ff058a7e62aa3a6e835e9eb5":
      "<strong>Utilisation autorisée.</strong> East Agile reconnaît que l'utilisation de “Notional Trademark”, à l'exclusion de tout logo, peut être nécessaire pour se référer aux produits ou services d'East Agile. Toute utilisation de ce type doit être précise et descriptive. Toute autre utilisation de “Notional Trademark” nécessitera un accord de licence de marque signé et devra être conforme aux directives d'East Agile. En utilisant “Notional Trademark”, vous reconnaissez qu'East Agile est le propriétaire exclusif de “Notional Trademark” et vous ne remettrez pas en question, n'interférerez pas ni n'interromprez la propriété exclusive d'East Agile sur “Notional Trademark”. Vous ne pouvez pas enregistrer “Notional Trademark” ou tout signe pouvant prêter à confusion avec “Notional Trademark”.",
