    "74aaefadbc4d8facf496cf590a152e21508e5d7126605a19deea0f6ed342958b":
      'Notionalはその技術を厳重に保護し、ライセンス契約の資格によってのみ他者に使用を認可します。Notionalの許可なくサービスを使用または配布することは、ソフトウェアの違法コピーに該当します。サービスの無断使用について自分自身または他人のために支援が必要な場合は、<a class="inline-link" href="mailto:notional@eastagile.com">notional@eastagile.com</a>までNotionalにお問い合わせください。',
