    "227b6c48fae5df3ce02510ec8bb058b133ed4eeb6cc5602649b024b0c4e271ed":
      "일반 정보 본 정책(“개인정보 처리방침”)은 The Stanyan Group(“East Agile”) 및 그 자회사가 Notional 웹사이트의 사용자로부터 또는 사용자에 대한 어떤 정보를 수집하는지를 설명합니다. 여기에는 East Agile이 웹사이트를 통해 제공할 수 있는 모든 콘텐츠(총칭하여 “Notional 웹사이트”), Notional 서비스 또는 East가 제공하는 기타 서비스가 포함됩니다.",
