    "45ac03ae7e5beaebeddcf76962e8a2cccd230bb69ab084763bd58b389e20bda1":
      '이용 약관(이하 <strong>“약관”</strong>)을 The Stanyan Group(<strong>“East Agile”</strong>) 및 그 제휴사(<strong>“Notional”</strong>)의 웹사이트 및 서비스를 사용하기 전에 주의 깊게 검토해 주십시오. 이러한 웹사이트 또는 서비스를 접근, 탐색 또는 사용함으로써, 귀하는 이 약관을 읽고 이해하였으며 이에 따른 규정을 준수하겠다는 것에 전적으로 동의함을 인정합니다. 만약 이 약관에 동의하지 않으신다면, East Agile의 웹사이트 및 서비스를 사용할 권한이 없습니다. 여기에는 <a class="link-4" href="https://notional.ai/">notional.ai</a>가 포함되지만 이에 국한되지 않습니다. 이 약관은 웹사이트와 서비스, East Agile이 웹사이트를 통해 제공할 수 있는 모든 콘텐츠(텍스트, 데이터, 정보, 소프트웨어, 그래픽 또는 사진 등 포함, 이하 <strong>“자료”</strong>) 및 East Agile이 웹사이트를 통해 제공할 수 있는 모든 서비스(이하 <strong>“서비스”</strong>)에 대한 귀하의 사용을 규제합니다. 웹사이트, 자료 및 서비스는 본 약관에서 총칭하여 <strong>“Notional 웹사이트”.</strong>로 지칭됩니다.',
