    fd9571c0dbe1c78b3305c52c4eb9abaeebf3d8cf149bbcf6b9608e79ca13826a:
      'Todos los productos y publicaciones de East Agile son de naturaleza comercial. El software, las publicaciones y la documentación del software disponibles en los Sitios Web Notionales son "Artículos Comerciales", según se define ese término en 48 C.F.R. §2.101, que consiste en "Software de Computadora Comercial" y "Documentación de Software de Computadora Comercial", según se definen esos términos en 48 C.F.R. §252.227-7014(a)(1) y 48 C.F.R. §252.227-7014(a)(5), y utilizados en 48 C.F.R. §12.211, 48 C.F.R. §12.212 y 48 C.F.R. §227.7202, según corresponda. De acuerdo con 48 C.F.R. §12.211, 48 C.F.R. §12.212, 48 C.F.R. §252.227-7015, 48 C.F.R. §227.7202 a través de 227.7202-4, 48 C.F.R. §52.227-19 y otras secciones relevantes del Código de Regulaciones Federales, según corresponda, las publicaciones de East Agile, el software de computadora comercial y la documentación del software de computadora comercial se distribuyen y licencian a los usuarios finales del Gobierno de los Estados Unidos con solo esos derechos que se otorgan a todos los demás usuarios finales, de acuerdo con los términos y condiciones contenidos en los acuerdos de licencia que acompañan a los productos y la documentación del software y los términos y condiciones aquí expuestos.',
