    "54e03452a8918f39974af16e7091c5bacfff0f2f926b2b2d750028299d5a9974":
      "Usted acepta indemnizar, defender, liberar y mantener a East Agile, sus padres, subsidiarias, afiliados, funcionarios, directores, agentes, socios, empleados y licenciantes indemnes de cualquier reclamo, responsabilidad, demanda, pérdida, daño, costo, gasto y honorarios (incluidos los honorarios razonables de abogados) que dichas partes puedan incurrir como resultado de o que surja de: (1) su uso (o el de cualquier persona que use su cuenta, computadora o Software) de los Sitios Web Notionales o la violación o incumplimiento de estos Términos; (2) su contenido; (3) cualquier infracción o apropiación indebida de cualquier Derecho de Propiedad Intelectual (definido a continuación) por usted, sus clientes o sus proveedores; (c) la violación de leyes, reglas, regulaciones, etc. por usted; o (4) su uso de cualquier contenido de terceros. Nosotros (i) le proporcionaremos un aviso de dicho reclamo dentro de un período de tiempo razonable después de conocer el reclamo; y (ii) cooperaremos razonablemente en respuesta a sus solicitudes de asistencia (sujeto a su reembolso de nuestros costos y gastos). East Agile se reserva el derecho de asumir la defensa y el control exclusivos de cualquier asunto que de otro modo esté sujeto a indemnización por su parte y, en tal caso, usted acepta cooperar con la defensa de East Agile de dicho reclamo, y en ningún caso podrá aceptar ningún acuerdo que afecte a East Agile sin el consentimiento por escrito de East Agile.",
    "4d65f5deced9ed3c887bb74f3780ca2386455894344ad2dd85c27f521582697a":
      "“Derechos de Propiedad Intelectual” significa todos los derechos de propiedad intelectual en todo el mundo, incluidos, sin limitación, “patentes, modelos de utilidad, derechos sobre invenciones, derechos de autor y derechos relacionados, marcas comerciales y de servicio, nombres comerciales y nombres de dominio, derechos en la presentación, buena voluntad y el derecho a demandar por suplantación o competencia desleal, derechos en diseños, derechos en software informático, derechos de base de datos, derechos para preservar la confidencialidad de la información (incluido el know-how y secretos comerciales) y cualquier otro derecho de propiedad intelectual, incluidos todas las solicitudes de (y derechos para solicitar y ser concedidos), renovaciones o extensiones de, y derechos para reclamar prioridad de, dichos derechos y todos los derechos o formas de protección similares o equivalentes que existan o existirán, ahora o en el futuro, en cualquier parte del mundo.",
