    dd22d4ddfe8426930de1f38e0b3f2836a884a92385fc884292c566c2d11f373f:
      "QUÉ SOMOS Establecida en 1997, somos una empresa de desarrollo de software que se especializa en el uso de prácticas Agile. Nuestro experimentado equipo de ingenieros entrega resultados de manera rápida y frecuente, manteniendo un fuerte enfoque en la calidad, flexibilidad y facilidad de mantenimiento. Nuestra experiencia radica en el desarrollo de sistemas fuera de sitio y en la consultoría analítica tanto en sitio como fuera de sitio. QUÉ HACEMOS",
