      "我们可能会不时向您发送推送通知，以便告知您我们正在进行的任何活动或促销。如果您不再希望接收这类通讯，您可以通过选择退出在设备级别关闭它们。为了确保您能收到正确的通知，我们需要收集有关您设备的某些信息，例如操作系统和用户身份信息。",
