    "38795ff961da34f7d1a03974206187040d37ef3c7b6ce203acca1b3ef5e84dc5":
      "您的营销选择。您决定提供我们可能不时请求的个人信息是自愿的。然而，如果您未提供所请求的个人信息，您可能无法继续进行该活动或无法获得所请求的个人信息所带来的利益。您始终可以通过遵循您收到的电子邮件或其他通信中的具体说明，或通过以下描述的适当方法通知我们，从 East Agile 取消订阅或选择不接收促销材料。处理您的请求可能需要合理的时间，但对于电子邮件促销不得超过 10 个工作日。在 East Agile 依法需要这样做的国家，East Agile 将为您提供在发送促销材料或拨打促销电话之前提供选择加入同意的机会。此规定不适用于被视为某些服务提供的一部分的服务通讯，您可能会定期收到这些通讯，除非您取消适用的服务提供。",
    "21877482ac7d332d33fdd407a17c5724509ebb963db69070fb0a5edc870618f0":
      "您的个人信息访问权限。East Agile 努力保持您的个人信息准确。我们已实施技术、管理流程和政策，以维护数据完整性。我们将根据相关法律向您提供合理的个人信息访问权限，包括通过合理努力向您提供在线访问和更新您信息的机会。为了保护您的隐私和安全，在授予访问权限或对您的个人信息进行更改之前，我们将采取措施验证您的身份。根据请求，East Agile 将提供您是否持有您个人信息的相关信息。要请求访问、更正、删除或转移您的个人信息，请按照以下适用的说明操作。尽管我们将作出合理努力来满足您的请求，但如果适用法律要求或允许，我们也保留拒绝此类请求或对其施加某些限制和要求的权利。我们将在合理的时间内回复您的请求。",
    f8a7ec0f2934e3e81d8c185461443ba9d87832c54d547f017ac561e1e19b3ed6:
      "我们的信息保留政策。我们将根据您的账户是否活跃或需要提供给您Notional Websites、Service Offerings和移动应用程序的时间保留您的个人信息。如果您希望取消您的账户或请求我们不再使用您的个人信息来提供软件或服务，请通过以下提供的适用方法与我们联系。即使在我们取消您的账户或停止使用您的个人信息来为您提供软件或服务后，我们仍可能根据法律、监管、道德或文档保留义务保留、使用和披露您的信息，并且任何删除您的个人信息的请求都受到这些义务和限制的约束。",
    "2783781dea091892d876adf6c1dd8dbb0dbdf2045d9ade8561560c3ac49af3e4":
      "个人信息安全<br>",
    "607d03a45ab37661404ef312427c983c042ef9dcb07fc73f260b1e849548d3e4":
      "East Agile已实施行政、技术和物理措施，旨在保护您的个人信息免受意外丢失以及未经授权的访问、披露、使用、修改或销毁。这些措施包括计算机安全防护、保护文件和建筑的安全、互联网防火墙、入侵检测、防病毒保护、网络监控，以及在适用法律要求下适当使用的传输层安全 (“TLS”) 或类似加密浏览器。然而，无法保证电子数据传输或信息存储是100%私密和安全的，您理解East Agile并不确保或担保我们从您身上收集的任何信息的隐私或安全，您使用Notional Websites并向我们提供信息的风险自负。如果使用密码来帮助保护您的账户和个人信息，您有责任保持密码的机密性。请小心避免“网络钓鱼”骗局，可能有人会向您发送看似来自East Agile的电子邮件，要求提供个人信息。East Agile绝不会通过电子邮件请求您的个人信息。如果您对您的个人信息的安全性有任何疑问，可以通过下面提供的联系方式与我们联系。",
