    db39cf36184e812c9a34b3496a7ee8ffd7cf847545a000253cb1fe121062a7d3:
      "تغييرات على سياسة الخصوصية هذه<br>",
    "88bd8fd8ba1fcf33ffef666e50dd3b3756fe3e0f752618ac0f6727523ac64138":
      "قد تقوم East Agile بتحديث سياسة الخصوصية هذه بشكل دوري، وسنذكر تاريخ آخر مراجعة لها أعلاه. إذا قمنا بإجراء تغييرات جوهرية على سياسة الخصوصية هذه، سنقوم بإخطارك إما من خلال نشر إشعار عن هذه التغييرات بشكل بارز قبل تنفيذ التغييرات أو من خلال إرسال إشعار مباشرة إليك. نشجعك على مراجعة سياسة الخصوصية هذه بشكل متكرر لتكون على علم بكيفية قيام East Agile بجمع معلوماتك، واستخدامها، والاحتفاظ بها، وحمايتها، وكشفها، ونقلها.",
