    c910d474dcd724bff83ddedeb06bf1eceaf9fb3af7c76bb282be057f36e6dffa: "عام",
    "45ac03ae7e5beaebeddcf76962e8a2cccd230bb69ab084763bd58b389e20bda1":
      'يرجى مراجعة شروط الاستخدام هذه (<strong>“الشروط”</strong>) بعناية قبل استخدام مجموعة ستانيان (<strong>“East Agile”</strong>)، وشركاتها التابعة (<strong>“Notional”</strong>) ومواقعها وخدماتها. من خلال الوصول إلى هذه المواقع أو تصفحها أو استخدامها، فإنك تقر تمامًا بأنك قد قرأت وفهمت وتوافق على الالتزام بهذه الشروط والامتثال لجميع القوانين واللوائح المعمول بها. إذا كنت لا توافق على هذه الشروط، فأنت غير مخول لاستخدام مواقع وخدمات East Agile، بما في ذلك على سبيل المثال لا الحصر <a class="link-4" href="https://notional.ai/">notional.ai</a>. تتحكم هذه الشروط في استخدامك للمواقع والخدمات، وأي محتوى (مثل النصوص أو البيانات أو المعلومات أو البرامج أو الرسومات أو الصور الفوتوغرافية) التي قد تقدمها East Agile من خلال المواقع (مجتمعة، <strong>“المدخلات”</strong>) وأي خدمات قد تقدمها East Agile من خلال المواقع (مجتمعة، <strong>“الخدمات”</strong>). يُشار إلى المواقع والمدخلات والخدمات في هذه الشروط مجتمعة باسم <strong>“مواقع Notional.”</strong>',
