    "1b8036bf1b13621262112a53459eee8302d681aac82f90105efe07ee1799e342":
      "本政策（“隱私政策”）解釋了 The Stanyan Group（<strong>“East Agile”</strong>）及其子公司和關聯公司或我們的服務提供商從 Notional 網站的用戶收集的哪些信息，包括 East Agile 可能通過網站提供的任何內容（統稱為 “Notional 網站”）、Notional 服務或 East Agile 可能通過 Notional 網站提供的任何其他服務（統稱為 “服務提供”）、我們的移動應用程序以及其他互動（例如，客戶服務查詢、用戶會議等），並說明了我們對這些信息的處理慣例。如果您在歐洲經濟區（EEA）以外，通過訪問文件、瀏覽或以其他方式使用 Notional 網站，您已同意按照本隱私政策所述使用您的數據。如果您在 EEA，通過訪問 Notional 網站，您已同意按照本隱私政策所述使用我的數據。它還描述了有關個人信息使用、訪問和收集的選擇，以及我們處理的您個人數據的權利。如果您不同意這些條款，請不要訪問或使用 Notional 網站、服務提供、移動應用程序或 East Agile 業務的任何其他方面。",
