      "本私隱政策適用於從 Notional Website 或其服務提供者收集的個人資料及其他資訊，這些資料是來自或關於 Notional Websites 的使用者、服務提供、我們的流動應用程式和其他互動（例如，客戶服務查詢、使用者會議等）。除非以下另有說明，否則本私隱政策不適用於任何其他產品或服務，或以任何其他方式（無論是線上或線下）收集的資訊，或為任何其他目的收集的資訊。",
