    a0499f3c2a4dd87c0a7b0920d6dfe89f248e4719407947e61dcf5819fe24895c:
      "如法律另有要求或許可；及/或",
    "6b185cc9b4e19861ed08d32453eed3c007dd75f4a718bb62345e952b6811578a":
      "在你的同意下。",
    "5676f436c6f57044c49ac68db245f654b3a712796302ffc7c4ca760a7dcd3c8b":
      "在某些情況下，East Agile 提供歐盟標準條款，也稱為標準合同條款，以滿足我們在歐盟運營的客戶以及其他國際客戶數據轉移的充分性和安全性要求。<br>",
    "12a7ca2ac6e68d47f2331ac559c8413105ea513f9c015c8b018951f5c3309826":
      "除非相關法律允許，East Agile 不會分享、出售、交易或租賃您的個人資訊給任何其他人，除了在本隱私政策中所規定的情況。<br>",
    "43ea6aad5b4255b25cd4fea5e09f338ecf188d986571843e64a0f0cf1b46f3a9":
      "市場選擇、訪問您的個人信息的權利，及我們的保留<br>",
    "38795ff961da34f7d1a03974206187040d37ef3c7b6ce203acca1b3ef5e84dc5":
      "您的營銷選擇。您決定提供我們可能不時要求的個人信息是自願的。然而，如果您不提供所要求的個人信息，您可能無法繼續進行該活動或獲得所請求的個人信息所帶來的利益。您可以隨時退訂或選擇不接收 East Agile 的促銷材料，方法是按照您收到的電子郵件或其他通訊中的具體指示操作，或通過下述適當的方法通知我們。處理您的請求可能需要合理的時間，但針對電子郵件促銷最多不會超過 10 個工作日。在 East Agile 法律要求的國家，East Agile 將會在發送促銷材料或進行促銷電話之前，給予您提供選擇性同意的機會。這不適用於被視為某些服務產品一部分的服務通訊，除非您取消相關的服務產品，否則您可能會定期收到這些通訊。",
    "21877482ac7d332d33fdd407a17c5724509ebb963db69070fb0a5edc870618f0":
      "您的個人信息訪問權。East Agile 致力於保持您的個人信息準確。我們已實施技術、管理流程和政策，以維護數據完整性。我們將根據相關法律，為您提供合理的訪問個人信息的機會，包括通過合理努力提供在線訪問和更新信息的機會。為了保護您的隱私和安全，我們將採取措施在授予訪問權或更改個人信息之前驗證您的身份。應要求，East Agile 將向您提供我們是否持有任何您的個人信息的信息。要請求訪問、更正、刪除或轉移您的個人信息，請遵循以下適用的指示。雖然我們會合理努力滿足您的請求，但如果法律要求或允許，我們也保留拒絕此類請求的權利，或對此類請求施加某些限制和要求。我們將在合理的時間範圍內回應您的請求。",
    f8a7ec0f2934e3e81d8c185461443ba9d87832c54d547f017ac561e1e19b3ed6:
      "我們對您的資料的保留。我們將在您的帳戶活躍期間或在需要提供您 Notional Websites、服務產品和手機應用程序的期間，保留您的個人信息。如果您希望取消帳戶，或要求我們不再使用您的個人信息來提供您軟件或服務，請通過以下提供的適用方法與我們聯繫。即使在我們取消您的帳戶或停止使用您的個人信息來提供您軟件或服務後，我們仍可能根據法律、監管、倫理或資料保留義務的要求，保留、使用和披露您的信息，而任何刪除您個人信息的請求都須遵守這些義務和限制。",
    "2783781dea091892d876adf6c1dd8dbb0dbdf2045d9ade8561560c3ac49af3e4":
      "您的個人資訊安全<br>",
    "607d03a45ab37661404ef312427c983c042ef9dcb07fc73f260b1e849548d3e4":
      "East Agile 已實施行政、技術和物理措施，以保護您的個人信息免受意外丟失以及未經授權的訪問、披露、使用、更改或毀壞。這些措施包括計算機保障和安全文件與建築物、互聯網防火牆、入侵檢測、抗病毒保護、網絡監控，以及在適當情況下和根據適用法律的要求，傳輸層安全性（“TLS”）或類似加密瀏覽器。然而，無論何種電子數據傳輸或信息存儲都無法保證100%私密和安全，您明白 East Agile 不保證或確保我們從您那裡收集的任何信息的私密性或安全性，您使用 Notional Websites 並提供信息的風險由您自行承擔。如果使用密碼來幫助保護您的帳戶和個人信息，您有責任保持密碼的保密性。請小心避免“網絡釣魚”詐騙，某些人可能會發送看似來自 East Agile 的電子郵件，要求您提供個人信息。East Agile 絕不會通過電子郵件要求您的個人信息。如果您對您的個人信息的安全性有任何疑問，您可以按照下面的方式與我們聯繫。",
    "404b7a8c8ab47da980d2855796d0cba7cd44a64d1a8ca38196f4ddae9dbaf961":
      "您的加州隱私權<br>",
    d9d3a0f50ae7176fcd2bedb0041b2b86bacb185c4ab650d19fda59ca50d383bc:
      "如果您是加州居民，加州民法典 §1798.83 允許您要求East Agile 在過去一年內向其附屬公司和/或第三方披露您的個人信息以進行直接營銷的相關信息。要提出此類請求，請按照以下方式聯繫我們。",
    "589d4f60258ef35d1619a15fe3d556442bba1f09b7bcc46fb4da2fdc99ba1f2c":
      "假想的聯絡資訊，用於營銷選擇、要求訪問、修正刪除或轉移，以及對本隱私政策的問題和執行<br>",
