    dbe8b4347cbb7b7c28652c658ebb48ba9aa532a45ebe2ce387c01fcec34ee518:
      "Compartilhando Suas Informações<br>",
    b3f17e79ed32865ad03a5b3420b7967a47c96ce7a4e6c2fbf18d7969d826de36:
      "East Agile pode compartilhar informações não pessoais (por exemplo, dados anônimos e agregados) sem restrições. Notional pode compartilhar suas informações pessoais conforme descrito nesta Política de Privacidade e com seus provedores de serviços e fornecedores na medida necessária para fornecer os Websites ou Ofertas de Serviço da Notional que você solicitou, responder às suas solicitações de informações sobre Software ou Ofertas de Serviço, ou de outra forma apoiar suas necessidades comerciais. Se você optar por não compartilhar suas informações com esses provedores de serviços de terceiros para esses fins, pode ser que não consigamos fornecer os Websites da Notional, Ofertas de Serviço, aplicativos móveis, informações ou suporte que você solicitou.",
    "7dcc46ce73d40ea7b11b849a9b6dce21562266ab20bd3ad891f0edaefa71b873":
      "Provedores de serviços e fornecedores de terceiros que recebem informações pessoais estão autorizados a usar suas informações pessoais apenas para a finalidade para a qual foram originalmente destinadas ou conforme exigido ou permitido por lei. No entanto, salvo disposição em contrário por lei ou acordo, a East Agile não se responsabiliza por qualquer uso impróprio por essas partes.",
