    "1b8036bf1b13621262112a53459eee8302d681aac82f90105efe07ee1799e342":
      "Diese Richtlinie („Datenschutzerklärung“) erklärt, welche Informationen The Stanyan Group (<strong>„East Agile“</strong>) und seine Tochtergesellschaften und Partner oder unsere Dienstleister von oder über Nutzer der Notional-Websites sammeln, einschließlich aller Inhalte, die East Agile über die Websites bereitstellen kann (gemeinsam „Notional-Websites“), die Notional-Dienste oder andere Dienste, die East Agile über die Notional-Websites bereitstellen kann (gemeinsam „Serviceangebot“), unsere mobilen Anwendungen und andere Interaktionen (z. B. Kundenservice-Anfragen, Benutzerkonferenzen usw.) und beschreibt unsere Praktiken bezüglich solcher Informationen. Wenn Sie sich außerhalb des Europäischen Wirtschaftsraums (EWR) befinden, haben Sie durch den Zugriff auf Dateien, das Durchsuchen oder die Nutzung der Notional-Websites der Verwendung Ihrer Daten gemäß dieser Datenschutzerklärung zugestimmt. Wenn Sie sich im EWR befinden, haben Sie durch den Zugriff auf die Notional-Websites der Verwendung Ihrer Daten gemäß dieser Datenschutzerklärung zugestimmt. Sie beschreibt auch die Optionen hinsichtlich der Nutzung, des Zugriffs und der Sammlung personenbezogener Daten sowie Ihre Rechte an Ihren personenbezogenen Daten, die wir verarbeiten. Wenn Sie mit den Bedingungen nicht einverstanden sind, greifen Sie bitte nicht auf die Notional-Websites, die Serviceangebote, die mobilen Anwendungen oder andere Aspekte von East Agiles Geschäft zu.",
