    "41c837bf4e16f4130d279fe2f445c599de1188468d3dcce6eee4beb0469bdc15":
      "eine Erklärung, dass Sie guten Glaubens glauben, dass die Nutzung des Materials in der beanstandeten Weise nicht vom Urheberrechtsinhaber, seinem Vertreter oder dem Gesetz autorisiert ist; und",
    "9ac01b51555ddc75ce7660212a58a9ec2295ecca1e4bf8776de244742379d54f":
      "eine Erklärung, abgegeben unter Strafandrohung des Meineids, dass die obigen Informationen korrekt sind und dass Sie der Urheberrechtsinhaber sind oder befugt sind, im Namen des Eigentümers zu handeln.",
    "424bb3213addf62939354d5c33f181d93fb142762baf2b1ffec133ca8d741985":
      'Sie können eine Mitteilung über einen Anspruch auf Urheberrechtsverletzung an die Notional Legal Department senden an: East Agile, ATTN: Notional Legal Department, 9450 SW Gemini Dr. PMB 38234, Bearerton, OR 97008-7105, E-Mail – <a class="inline-link" href="mailto:notional@eastagile.com">notional@eastagile.com</a>.<br>',
